import React, { useParams } from 'react';
import { useNavigate } from 'react-router-dom';

function TitleSearch() {
  const navigate = useNavigate();
  const { url } = useParams();

  React.useEffect(() => {
    navigate(url);
    console.log(url)
  }, [navigate, url]); // Explicitly include dependencies

  return (
    <div>
    </div>
  );
}

export default TitleSearch;
